    "crescent-lake-national-wildlife-refuge-narrative-report-1-may-to-31-august-1957",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from May through August
    of 1957. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, fish, and
    disease- is also covered. The Refuge development and maintenance section discusses
    physical developments and wildfires. Resource management is outlined; topics include
    grazing and haying. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, and fishing. Items of interest, N-R forms, and photographs
    are attached. A short narrative report of North Platte National Wildlife Refuge
    is included.",nt"license_title": "License Not Specified",nt"extras":
